import React from "react";
import styled from "styled-components";

const header_bar = styled.div`
  text-align: center;
  height: 60px;
`;

const Header = () => {
  return (
    <header_bar>
      <a href="localhost:8080">살려줘</a>
    </header_bar>
  );
};

export default Header;
